			max-width: 1192px;
		}
	}

	.container {
		max-width: 1222px;
	}
	
	
	@media (min-width: 1222px) {

		[data-vc-full-width]:not([data-vc-stretch-content]) {
			padding-left: calc((100vw - 1222px) / 2);
			padding-right: calc((100vw - 1222px) / 2);
